        <div>
            <Route exact path="/modifycard" component={() =>
                <>
                    <p>Modify card</p>
                    {obj.connected() || obj.acceptNotLoginFnc() ?
                        <Form inputNames={["newBrand","last_4"]} inputTexts={["New brand","Last 4 digits of the card"]} buttonText={"Change the brand"} onSend={obj.handleBrandChangeForm} />
                        : "Connection requise"}
